Mark Chambers, &quot;Scanners For Dummies, 2nd Edition&quot;
English | 2004 | ISBN: 076456790X | PDF | 339 Pages | 11 MB

The real reason that scanners have enjoyed such a surge in popularity is that more computer owners now recognize just how useful a scanner can be. More applications that ever make use of your scanner, and the Internet makes it easy to share the documents and images you scan through e-mail or your Web site.
